    return (
        <div className="container">
            <div className="rnum">{props.items.RNUM}</div>
            <div className="id">{props.items.ID}</div>
            <div className="name">{props.items.NAME}</div>
            <div className="content">{props.items.CONTENT}</div>
        </div>
    );
};

export default Board;
